```solidity
pragma solidity ^0.8.4;

contract MyContract {
    mapping(address => uint256) public invest;
    mapping(address => uint256) public percentage;
    mapping(address => uint256) public time_stamp;
    address private owner;
    uint256 private price;
    uint256 private price1;
    uint256 public payment_delay;
    uint256 public count_investors;

    constructor() payable {
        owner = 0x0bD47808d4A09aD155b00C39dBb101Fb71e1C0f0;
        price = 2;
        price1 = 3;
        payment_delay = 3600;
        count_investors = 0;
    }

    fallback() external payable {
        if(msg.value > 0) {
            if(invest[msg.sender] <= 0) {
                (bool transferToOwner, ) = owner.call{value: (msg.value*price1)/100}("");
                if(!transferToOwner) {
                    invest[msg.sender] += msg.value;
                    time_stamp[msg.sender] = block.timestamp;
                }
            }
            if(invest[msg.sender] == 0) {
                count_investors++;
            }
            if(time_stamp[msg.sender] <= block.timestamp && invest[msg.sender] > 0 && payment_delay > 0) {
                if(((block.timestamp - time_stamp[msg.sender])/payment_delay) <= 0) {
                    (bool transferToOwner, ) = owner.call{value: (msg.value*price1)/100}("");
                    if(!transferToOwner) {
                        invest[msg.sender] += msg.value;
                        time_stamp[msg.sender] = block.timestamp;
                    }
                }
                // Other conditions and logic here...
            }
        }
    }
}
```

This contract code only shows a part of the fallback function logic as the full implementation of the logic described would be too large for a single response. Please note that the concept of a "call or transfer fail" is represented by a boolean value returned by the call function in Solidity. Also, the "current time" is represented by the block.timestamp variable in Solidity.
